import React from 'react'; 
import { Container, Row, Col, Button } from 'reactstrap';
import { Link } from "react-router-dom";
import '../styles/admin-dashboard.css'; // Ensure you have the correct CSS file

const AdminDashboard = () => {
  return (
    <section>
        <Container>
            <Row>
                <Col lg='12' className='pt-5 text-center'>
                  <div className="admin__dashboard">
                     <span><i className='ri-admin-line'></i></span> {/* Change icon as needed */}
                     <h1 className='mb-3 fw-semibold'>Admin Dashboard</h1>
                     <h3 className='mb-4'>Welcome to the Admin Panel</h3>

                     <Button className='btn primary__btn w-25'>
                        <Link to="/home">Back to Home</Link>
                     </Button>
                  </div>
                </Col>
            </Row>
        </Container>
    </section>
  )
}

export default AdminDashboard;
